  [],\n\t\"num_tags\": 0,\n\t\"name\": \"current-meter-components-and-other-data-from-fixed-platforms-as-part-of-the-world-ocean-circula\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Current meter components data were collected
  from FIXED PLATFORMS. Data were collected by Oregon State University (OSU) as part
  of the World Ocean Circulation Experiment (WOCE) 26 February 1992 to 14 April 1993.
  Data were processed by NODC to the NODC standard F015 Current Meter Components format.
  Format could be shifted one space to the left. Full format description is available
  from NODC at www.nodc.noaa.gov/General/NODC-Archive/f015.html.nnThe F015 format
  contains time series measurements of ocean currents. These data are obtained from
  current meter moorings and represent the Eulerian method of current measurement,
  i.e., the meters are deployed at a fixed point and measure flow past a sensor. Position,
  bottom depth, sensor depth and meter characteristics are reported for each station.
  The data record includes values of east-west (u) and north-south (v) current vector
  components at specified date and time. Current direction is defined as the direction
  toward which the water is flowing with positive directions east and north. Data
  values may be subject to averaging or filtering and are typically reported at 10
  - 15 minute time intervals. Water temperature, pressure and conductivity or salinity
  may also be reported. A text record is available for optional comments.\",\n\t\"owner_org\":
